import { Controls } from "node-editor";
import { isBase64UrlImage } from "../presets/miscellaneous";
import { useEffect, useState } from "react";

export const imageScreenshot = {
  type: "imageScreenshot",
  name: "imageScreenshot",
  label: "Image screenshot",
  controls: [
    Controls.text({
      name: "image",
      label: "Image (Base64)",
    }),
    Controls.custom({
      name: "imageRender",
      render: (...props) => <Img props={props} />,
    }),
  ],
};

const Img = ({ props: [data, onChange, , redraw, , inputData] }) => {
  const [isValid, setValid] = useState(false);

  useEffect(() => {
    isBase64UrlImage(inputData.image).then(setValid);
    setTimeout(redraw, 50);
  }, [inputData]);

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      {data}
      <button onClick={() => onChange(35)} />
      {isValid && (
        <img style={{ width: "100%" }} src={inputData.image} alt="" />
      )}
    </div>
  );
};

